// simplified way to know if this is fixed form duplicate in parse_fortran.l
static bool recognizeFixedForm(const QString &contents, FortranFormat format)
{
   int column = 0;
   bool skipLine = false;

   if (format == FortranFormat_Fixed) {
      return true;
   }

   if (format == FortranFormat_Free) {
      return false;
   }

   for (int i = 0; true; i++) {
      column++;

      switch (contents[i].unicode()) {
         case '\n':
            column = 0;
            skipLine = false;
            break;

         case ' ':
            break;

         case '#':
            skipLine = true;
            break;

         case '\000':
            return false;

         case 'C':
         case 'c':
         case '*':
            if (column == 1) {
               return true;
            }
            if (skipLine) {
               break;
            }
            return false;

         case '!':
            if (column > 1 && column < 7) {
               return false;
            }
            skipLine = true;
            break;

         default:
            if (skipLine) {
               break;
            }
            if (column == 7) {
               return true;
            }
            return false;
      }
   }

   return false;
}

